Подвесной кабель-канал
======================

[![assets/PRODUKTAI/NARBUTAS/AKSESUARAI/_resampled/SetWidth100-DNZ022r.jpg](/assets/PRODUKTAI/NARBUTAS/AKSESUARAI/_resampled/SetWidth100-DNZ022r.jpg)](/assets/PRODUKTAI/NARBUTAS/AKSESUARAI/DNZ022r.jpg "Горизонтальные кабель-каналы (DNZ019, DNZ020, DNZ021 и DNZ022)")

[![assets/PRODUKTAI/NARBUTAS/AKSESUARAI/_resampled/SetWidth100-DNZ019r.jpg](/assets/PRODUKTAI/NARBUTAS/AKSESUARAI/_resampled/SetWidth100-DNZ019r.jpg)](/assets/PRODUKTAI/NARBUTAS/AKSESUARAI/DNZ019r.jpg "Горизонтальные кабель-каналы (DNZ019, DNZ020, DNZ021 и DNZ022)")

**Горизонтальные кабель-каналы (DNZ019, DNZ020, DNZ021 и DNZ022)**  

*   Металлический (белый, антрацитовый или металлик);
*   DNZ019 - 500 x 100, H=110 mm;
*   DNZ020 - 1100 x 100, H=1110 mm;
*   DNZ021 - 500 x 380, H=110 mm;
*   DNZ022 - 1100 x 380, H=1110 mm.

[![assets/PRODUKTAI/NARBUTAS/AKSESUARAI/_resampled/SetWidth100-DNZ017r2.jpg](/assets/PRODUKTAI/NARBUTAS/AKSESUARAI/_resampled/SetWidth100-DNZ017r2.jpg)](/assets/PRODUKTAI/NARBUTAS/AKSESUARAI/DNZ017r2.jpg " Горизонтальные кабель-каналы (DNZ017 и DNZ015)")

[![assets/PRODUKTAI/NARBUTAS/AKSESUARAI/_resampled/SetWidth100-DNZ015r.jpg](/assets/PRODUKTAI/NARBUTAS/AKSESUARAI/_resampled/SetWidth100-DNZ015r.jpg)](/assets/PRODUKTAI/NARBUTAS/AKSESUARAI/DNZ015r.jpg " Горизонтальные кабель-каналы (DNZ017 и DNZ015)")

**Горизонтальные кабель-каналы (DNZ017 и DNZ015)**  

*   Металлический (белый, антрацитовый или металлик);  

*   DNZ017 - 705 x 390, H=105 мм;
*   DNZ015 - 705 x 150, H=105 мм.

[![assets/PRODUKTAI/NARBUTAS/AKSESUARAI/_resampled/SetWidth100-DNZ004-01.jpg](/assets/PRODUKTAI/NARBUTAS/AKSESUARAI/_resampled/SetWidth100-DNZ004-01.jpg)](/assets/PRODUKTAI/NARBUTAS/AKSESUARAI/DNZ004-01.jpg "Горизонтальные кабель-каналы (DNZ004)")

**Горизонтальные кабель-каналы (DNZ004)**  

*   Металлический (белый, антрацитовый или металлик);  

*   Возможны  разные варианты длины.  


[![assets/PRODUKTAI/NARBUTAS/AKSESUARAI/_resampled/SetWidth100-DZZ081-03r2.jpg](/assets/PRODUKTAI/NARBUTAS/AKSESUARAI/_resampled/SetWidth100-DZZ081-03r2.jpg)](/assets/PRODUKTAI/NARBUTAS/AKSESUARAI/DZZ081-03r2.jpg "Горизонтальный кабель-канал (DZZ081)")

**Горизонтальный кабель-канал (DZZ081)**  

*   Окрашенная сталь (черный, белый или цвет металлик);  

*   Возможны разные варианты длины.  


[![assets/PRODUKTAI/NARBUTAS/AKSESUARAI/_resampled/SetWidth100-Laidu-nuvedimo-kanalas-Horizontalus-02.JPG](/assets/PRODUKTAI/NARBUTAS/AKSESUARAI/_resampled/SetWidth100-Laidu-nuvedimo-kanalas-Horizontalus-02.JPG)](/assets/PRODUKTAI/NARBUTAS/AKSESUARAI/Laidu-nuvedimo-kanalas-Horizontalus-02.JPG "Горизонтальные каналы (DZZ082)")

**Горизонтальные каналы (DZZ082)**  

*   Крашенная сталь;  

*   прикрепл. к соед. панели (системы OPTIMA PLUS, OPTIMA C).
